import Layout from '../../components/Layout';
import Admin from '../../components/auth/Admin';
import { Grid, Label } from 'semantic-ui-react';

const AdminIndex = () => {
    const labelStyle = {
        margin: 5
    }

	return (
		<Layout>
			<Admin>
				<Grid>
					<h2>Admin Dashboard</h2>
					<Grid.Row>
						<Grid.Column width={6}>
							<div>
								<Label as="a" color="teal" tag style={labelStyle}>
									Featured
								</Label>
                                <Label as="a" color="teal" tag style={labelStyle}>
									Featured
								</Label>
                                <Label as="a" color="teal" tag style={labelStyle}>
									Featured
								</Label>
							</div>
						</Grid.Column>
						<Grid.Column width={6} />
					</Grid.Row>
				</Grid>
			</Admin>
		</Layout>
	);
};

export default AdminIndex;
